use goatthroat;

create table chemicals
(
    id         int,
    chemical   varchar(100) charset utf8mb4 null,
    gt100      varchar(50) charset utf8mb4  null,
    gt200      varchar(50) charset utf8mb4  null,
    gt300      varchar(50) charset utf8mb4  null,
    hose_rec_1 varchar(40) charset utf8mb4  null,
    hose_rec_2 varchar(40) charset utf8mb4  null,
    notes      varchar(250) charset utf8mb4 null,
    constraint chemicals_chemical_uindex
        unique (chemical),
    constraint chemicals_id_uindex
        unique (id)
);

alter table chemicals
    add primary key (id);

alter table chemicals modify id int auto_increment;

